import React from 'react'

function text(props)  {

        return (
            <div className="mt-3 text-temp">
                <input type="text" class="form-control text" onChange={props.FirstTextItem} ></input>
                <input type="text" class="form-control text" onChange={props.SecondTextItem} ></input>
                <input type="text" class="form-control text" onChange={props.ThirdTextItem} ></input>

            </div>
        )
}
export default text
